import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { createWorkplace, getAllWorkplaces } from '../services/api';

const DataPersistenceTest: React.FC = () => {
  const [workplaces, setWorkplaces] = useState<any[]>([]);
  const [name, setName] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    fetchWorkplaces();
  }, []);

  const fetchWorkplaces = async () => {
    try {
      const data = await getAllWorkplaces();
      setWorkplaces(data);
    } catch (error) {
      console.error('Error fetching workplaces:', error);
    }
  };

  const handleCreateWorkplace = async () => {
    if (!name) return;
    
    try {
      await createWorkplace({
        name,
        address: 'Test Address',
        sskRegistrationNo: '1234567890',
        taxOffice: 'Test Tax Office',
        taxNumber: '1234567890',
        price: 1000,
        riskLevel: 'low',
        employeeCount: 10,
        source: 'Test Source'
      });
      
      setName('');
      fetchWorkplaces();
    } catch (error) {
      console.error('Error creating workplace:', error);
    }
  };

  return (
    <div style={{ padding: '20px' }}>
      <h2>Data Persistence Test</h2>
      <div>
        <input 
          type="text" 
          value={name} 
          onChange={(e) => setName(e.target.value)} 
          placeholder="Workplace name"
        />
        <button onClick={handleCreateWorkplace}>Create Workplace</button>
      </div>
      <div>
        <h3>Workplaces:</h3>
        <ul>
          {workplaces.map((workplace) => (
            <li key={workplace.id}>{workplace.name}</li>
          ))}
        </ul>
      </div>
      <button onClick={() => navigate('/dashboard')}>Go to Dashboard</button>
      <button onClick={() => navigate('/experts')}>Go to Experts</button>
      <button onClick={fetchWorkplaces}>Refresh Data</button>
    </div>
  );
};

export default DataPersistenceTest;
